  false,\n\t\"url\": null,\n\t\"notes\": \"In 2006 and 2007 the NOAA Office for Coastal
  Management purchased services to reprocess existing digital multi-spectral imagery
  (ADS-40) and create digital benthic habitat data from this imagery for selected
  Texas coastal bend bays. The Center worked cooperatively with the Texas Parks and
  Wildlife Department (TPWD) and the Texas A and M University Center for Coastal Studies
  to develop benthic habitat data, primarily Submerged Aquatic Vegetation (SAV) for
  several coastal bays. This data will support the state's recently adopted Seagrass
  Monitoring Program which calls for regional mapping of SAV for status and trends
  assessment. The Center, Texas A and M, and TPWD have coordinated on the requirements
  of this project.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
